import React from 'react';

const ResumenFinal = ({ productosDelDia, puntuacionDelDia }) => {
  return (
    <div>
      <h2>Resumen Final del Día</h2>
      <h3>Puntuación total del día: {puntuacionDelDia}</h3>
      <ul>
        {productosDelDia.map(producto => (
          <li key={producto.id}>
            <h4>{producto.nombre}</h4>
            <img src={producto.imagenURL} alt={producto.nombre} width={50} /> {/* Imagen miniatura */}
            <p>Puntos obtenidos: {producto.puntos}</p> 
            {/* Asumiendo que cada producto tiene un campo 'puntos' con los puntos obtenidos por el usuario */}
            <a href={producto.urlCompra}>Enlace de Compra</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ResumenFinal;
